import React from "react";
import { Input } from "antd";

const { Search } = Input;

export const SeachBar = (props) => {
  return (
    <div
      style={{
        display: "flex",
        justifyContent: "center",
        width: "50%",
        alignItems: "center",
        margin: 40,
      }}
    >
      <Search
        onChange={props.handleChange}
        onPressEnter={props.handleSubmit}
        onSearch={props.handleSubmit}
        enterButton
        size="large"
        type="text"
        style={{
          position: "fixed",
          top: 70,
        }}
      />
    </div>
  );
};
